import axios from "axios";
import React from "react";
import { useEffect } from "react";

const Home = () => {
  useEffect(() => {
    const allProducts = async () => {
      const { data } = await axios.get("/data");
      console.log(data);
    };
    allProducts();
  }, []);

  return (
    <div>
      <p>my products</p>
    </div>
  );
};

export default Home;
